import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

const Signup = () => {
  const navigate = useNavigate();

  const [formData, setFormData] = useState({});

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      console.log("Form Data:", formData); // Log the formData here
      const response = await fetch('/api/signup', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json'
        },
        body: JSON.stringify(formData)
      });
      if (response.ok) {
        console.log("Signup successful");
        navigate('/login');
      } else {
        console.error('Signup failed');
      }
    } catch (error) {
      console.error('Error during signup:', error);
    }
  };

  const handleLogin = () => {
    console.log('Login');
    navigate('/login');
  };

  return (
    <div className="loginsec">
      <div className="leftlogin logs">
        <div className="llup">
          <h1><span>W</span>elcome,</h1>
          <h2>Kindly <span>Sign Up!!</span></h2>
        </div>
        <div className="lldown">
          <div className="lldown-box">
            <div className="ecchart ecm">
              {/* Ecc components */}
            </div>
          </div>
        </div>
      </div>
      <div className="rightlogin logs signup">
        <form onSubmit={handleSubmit} method="post" className="form">
          {/* Form inputs */}
        </form>
      </div>
    </div>
  );
};

export default Signup;
